pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract Products {
  address storeAccount = 0xbF1bbfF196EFD824a9d460FDe965861E8296F428;

  struct Product {
    uint id;
    string name;
    uint price;
    string coverImage;
    string[] platforms;
    uint256 creationDate;
    uint256 releaseDate;
    string developer;
    string distributor;
    string[] genres;
    string description;
    uint sales;
    bool isActive;
  }

  Product[] products;

  function getProducts() public view returns (Product[] memory) {
    return products;
  }

  function addProduct(Product memory product) public returns (bool success) {
    require(bytes(product.name).length > 0);
    require(product.price > 0);
    require(bytes(product.coverImage).length > 0);

    product.creationDate = block.timestamp;
    product.id = products.length;
    product.isActive = true;
    products.push(product);
    return true;
  }

  function removeProduct(uint id) public returns (bool success) {
    products[id - 1].isActive = false;
    return true;
  }
}
